import React, { Component } from 'react';
import { Link } from 'react-router-dom';
class Contact extends Component {
    state = {}
    render() {
        return ( 
            <div className="page3">
            <img className="photome" src="img/my photo/me.jpg" alt=""></img>
            <Link className="a" href="https://t.me/ShNoUdAYoUsSeF">
                <font className="tele">Connect Now Via Telegram</font>
            </Link>
            <div className="tools">
                <Link href="https://github.com/Shnouda-Youssef-Mounor"><img className="icon" src="img/contact/ghub.png" alt=""></img></Link>
                <Link href="https://www.facebook.com/shnouda.youssef.3"><img className="icon" src="img/contact/Facebook.png" alt=""></img></Link>
                <Link href="https://www.instagram.com/shnoudayoussefmounir/"><img className="icon" src="img/contact/insta.png" alt=""></img></Link>
            </div>
        </div>
        );
    }
}

export default Contact;
